import React, { Component} from 'react'
import '../Styling/global.css';
import classnames from 'classnames';
import styles from '../Styling/Final.module.css'
import * as Survey from "survey-react";
import {addFinal} from "../Utils/API";
import {addInteraction} from '../Utils/API'



export default class FinalMusicSophistication extends Component{
	constructor(props){
		super(props);
		
		this.goToNext = this.goToNext.bind(this);
	}
	
	
	goToNext(survey){
		const data = survey.data;
		const userId = localStorage.getItem('userId');
		const ms = localStorage.getItem('ms');
		addFinal(userId, ms, data);
		addInteraction(userId, ms, -1, 'goToThanks', 'click', 1);
		this.props.history.push({
			pathname: '/Thanks',
		})
		
		
	}
	
	
	render(){
		const styleContainer = classnames('container-rows', styles.container);
		const styleDivSurvey = classnames(styles.divSurvey);
		var surveyJSON = {"pages":[{"name":"page1","elements":[{"type":"image","name":"question1","imageLink":"data:image/png;base64,","imageHeight":200,"imageWidth":600},
			{"type":"checkbox","name":"question1","title":"I prefer to see the information about a song (see picture above)...","isRequired":true,
				"choices":[{"value":"item1","text":"Only in the scatter plot"},
					{"value":"item2","text":"Only in the form of bars"},
					{"value":"item3","text":"Only in the form of a total fit"},
					{"value":"item4","text":"A combination of a scatter plot and bars"},
					{"value":"item5","text":"A combination of a scatter plot and a total fit"}],"hasOther":true},
			{"type":"text","name":"question2","title":"Why do you prefer to see this information in this form?","isRequired":true},
			{"type":"text","name":"question3","title":"Did you run into technical difficulties? If yes, which ones?","isRequired":true},
			{"type":"text","name":"question4","title":"Any other comment?","isRequired":true}]}]}
		
		
		// 	{"type":"text","name":"question2","title":"Why do you prefer to see this information for one song/for all" +
	// 	" songs/not at all?","isRequired":true},
	// 	{"type":"text","name":"question3","title":"Did you run into technical difficulties? If yes, which ones?","isRequired":true},
	// 	{"type":"text","name":"question4","title":"Any other comments?","isRequired":true},
	// ]}]}
		
		
		
		return(
			<div
				className={styleContainer}
			>
				<div
					className={styleDivSurvey}
				>
					<Survey.Survey json={ surveyJSON } onComplete={ this.goToNext } />
				</div>
			</div>
		
		);
	}
}



